            const User = localStorage.getItem("User");
            if (User) {
                setUsername(User);
            }
        }, []);
  return (
    <div className='wishlist'>
        <Navbar/>
        <div className="header">
                    <h1>Welcome to My Anime Page{username && `, ${username}`}</h1>
        </div>
        Wishlist
    </div>
  )
}

export default Wishlist
